ramidal.'),(30,'Archivo','Concentración de documentos debidamente ordenados y seleccionados, también se refiere al conjunto de documentos que integran el expediente de la terminación o conclusión definitiva de Juicios.'),(31,'Área Geográfica','Superficie territorial que identifica a una o más localidades.'),(32,'Arma','Instrumento destinado para atacar o defender.'),(33,'Artesanía','Producto elaborado manualmente con materia prima natural.'),(34,'Artículo','Escrito de cierta extensión de un periódico, revista o publicación periódica; unidad de cuantificación unitaria; apartado que señala un mandamiento jurídico o normativo.'),(35,'Asamblea','Reunión de integrantes de comunidades, productores, instituciones o individuos en general, para tomar acuerdos sobre asuntos de su interés.'),(36,'Asesoría','Orientación y apoyo en la toma de decisiones o en la resolución de actividades. Brindar apoyo a personas o grupos sociales para atender, tramitar y resolver procedimientos.'),(37,'Asociación','Conjunto de personas que se agrupan para alcanzar un objetivo común y donde cada uno posee los mismos derechos y obligaciones.'),(38,'Atlas','Colección de mapas geográficos.'),(39,'Atleta','Persona físicamente capacitada con aptitudes para realizar un deporte.'),(40,'Audiencia','Evento en el que una autoridad recibe a personas para resolver asuntos. Exposición de argumentos y pruebas ante los tribunales.'),(41,'Auditoría','Proceso sistemático, para obtener, analizar, verificar y evaluar de manera objetiva, las evidencias relacionadas con los informes de las actividades económicas y de la gestión de las dependencias, entidades públicas, órganos autónomos del estado así como '),(42,'Auditorio','Público asistente a eventos. Edificio en el que se realizan eventos.'),(43,'Aula','Salón o sala donde se imparten clases.'),(44,'Autobús','Vehículo automotor de transporte colectivo.'),(45,'Autopista','Carretera acondicionada para grandes velocidades en ambas direcciones y sin que otros caminos l