 géneros, mediante el pago de un sueldo.'),(410,'Silo','Depósito de forrajes para la alimentación de animales o almacenamiento de granos.'),(411,'Simposium','Conferencia o reunión donde se tratan diferentes temas.'),(412,'Simulacro','Ensayo o práctica que se realiza para asegurar una mejor respuesta en casos de incendios, desastres o siniestros.'),(413,'Siniestro','Situación imprevista que origina daños o pérdidas en las personas.'),(414,'Sitio web  ','Es un conjunto de páginas web, comunes a un dominio de Internet o subdominio en la World Wide Web (www). A las páginas de un sitio web se accede desde una dirección raíz común (URL) llamada portada, que normalmente reside en el mismo servidor físico. '),(415,'Sistema','Estructura funcional compuesta de organismos, principios y normas, se refiere también a sistemas informáticos, los cuales son un conjunto de procesos y/o programas que permiten la ejecución de varias tareas de forma concurrente; dichos sistemas son utiliz'),(416,'Solicitante','Persona que requiere de información que prestan las entidades.'),(417,'Solicitud','Requerimiento que realiza una persona o instancia a otra, por medio de un  documento formal.'),(418,'Sociedad','Entidad creada por la ley, facultad para adquirir activos, incurrir en obligaciones y dedicarse a determinadas actividades. Se conforma por dos o más socios que adquieren diferentes grados de responsabilidad ante terceros, dependiendo de la forma jurídica'),(419,'Supervisión','Comprende las acciones de vigilancia, coordinación y ejecución de actividades y obras, de tal manera que éstas se realicen de acuerdo a lo programado y de manera satisfactoria.'),(420,'Taller','Área de trabajo con características especiales para actividades manuales o de enseñanza. También se considera a las reuniones de trabajo donde obtienen aprendizajes prácticos, se forman, desarrollan y perfeccionan hábitos, habilidades y capacidades.'),(421,'Tamiz neonatal','Prueba de detección para identificar en el recién nacido alguna enfermedad o trastorno de salud.'),(422,'Tanque','Depósito destinado para almacenar líquidos.'),(423,'Tecalli','Módulo de vigilancia por sector territorial para seguridad de la población.'),(424,'Tejido','Conjunto organizado de células que tienen la misma estructura y la misma función.'),(425,'Terapia','Tratamiento aplicado a pacientes para su rehabilitación.'),(426,'Terminal','Instalación que es a un tiempo origen y destino final de algún servicio de transporte.'),(427,'Testificación','Verificación de actos legales u otros que se celebran en las instituciones, dependencias, entidades y ayuntamientos.'),(428,'Tienda','Espacio físico que ofrece bienes y brinda un servicio, dichos bienes se pueden adquirir a través de la compra. '),(429,'Toca','Conjunto ordenado y foliado de documentos o piezas escritas, en los que se hace constar de todas  las actuaciones jurídicas  (resoluciones y diligencias), así como los actos de las partes y de los terceros, correspondientes a juicios o procedimientos de j'),(430,'Toma','Conexión a la instalación de la red general de agua potable.'),(431,'Tonelada','Unidad de peso equivalente a 1000 kg.'),(432,'Torneo','Desarrollo de concursos o eventos donde por eliminación queda un ganador.'),(433,'Trámite simplificado','Procedimiento que realiza la población, cuya respuesta es ágil y se da en una sola ventanilla.'),(434,'Tractor','Vehículo agrícola utilizado para el cultivo.'),(435,'Transformador','Dispositivo electromagnético que permite aumentar o disminuir el voltaje y la intensidad de una corriente alterna, de forma tal que el flujo de su producto permanezca constante.'),(436,'Transmisión','Acción y efecto de transmitir información por medios electrónicos.'),(437,'Traslado','Acción de transportar una cosa, generalmente un bien o personas de un lugar a otro. También es la acción de pasar una propiedad entre personas, identificando la posesión jurídica del bien.'),(438,'Tratamiento','Acción que se realiza para mejorar el estado o situación de una persona, de un bien o de información, según corresponda.'),(439,'Tríptico','Documento que contiene información, distribuida en tres páginas unidas, de modo que puedan doblarse las laterales sobre la del centro.'),(440,'Unidad','Se entiende por uno, (unidad de medida); singularidad numérica o en lo cualitativo, identificación de inmueble para su uso habitual.'),(441,'Unidad acuícola','Espacio destinado a la piscifactoría para la producción, reproducción o desarrollo de especies acuícolas.'),(442,'Unidad avícola','Espacio físico u organización para la cría de aves y el aprovechamiento de sus productos.'),(443,'Unidad económica','Entidad productora de bienes y servicios, pudiendo ser estos establecimientos, hogares o personas físicas.'),(444,'Unidad generadora de información','Unidad administrativa del sector público, privado o social que realiza actividades de producción de información geográfica, estadística o catastral, a través del aprovechamiento de sus registros administrativos.'),(445,'Unidad médica','Espacio físico con infraestructura y equipamiento médico para  proporcionar servicios de salud.'),(446,'Unidad industrial','Conjunto integrado y organizado por varias instalaciones que se encargan de realizar operaciones para la obtención y transformación de productos.'),(447,'Usuario','Persona que utiliza o se beneficia con la prestación de un bien o servicio público.'),(448,'Vacuna','Dosis aplicada para inmunizar contra enfermedades causadas por virus de las personas o animales.'),(449,'Vehículo','Medio de transporte para el traslado de personas, animales, plantas u objetos.'),(450,'Verificentro','Área de servicio al público, autorizado por la Secretaría del Medio Ambiente, en el que se lleva a cabo la medición de emisiones contaminantes provenientes de vehículos automotores.'),(451,'Vialidad','Espacio que ofrece servicios de acceso público y para la comunicación.'),(452,'Visitante','Persona que acude al territorio mexiquense con fines de recreación y esparcimiento.'),(453,'Visita','Presencia física en algún lugar, para inspeccionar, verificar o dejar constancia de un hecho o suceso.'),(454,'Vivero','Espacio de terreno cubierto, ocupado para el cultivo de diferentes especies de plantas.'),(455,'Vivienda','Espacio funcional que da protección a los individuos, familias o grupos sociales. ');
